import React from 'react';
import './App.css';
import Container from 'react-bootstrap/Container'
import Table from 'react-bootstrap/Table'

import axios from 'axios';

var obj;
var response;

var id;
var datetime;
var name;
var summary;
var url;
var type
var location;

var elements;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://polisen.se/api/events?DateTime=2021-01&type=Misshandel`)
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[0]];
        id = JSON.stringify(response[Object.keys(response)[0]]);
        datetime = JSON.stringify(response[Object.keys(response)[1]]);
        name = JSON.stringify(response[Object.keys(response)[2]]);
        summary = JSON.stringify(response[Object.keys(response)[3]]);
        url = JSON.stringify(response[Object.keys(response)[4]]);
        type = JSON.stringify(response[Object.keys(response)[5]]);
        location = JSON.stringify(response[Object.keys(response)[6]]);

        elements = {id: id, datetime: datetime, name: name, summary: summary, url: url, type: type, location: location}
        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<table striped bordered hover>
<thead>
  <tr>
    <th>Id</th>
    <th>Datetime</th>
    <th>Name</th>
    <th>Summary</th>
    <th>Url</th>
    <th>Type</th>
    <th>Location</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>{ this.state.persons.id}</td>
    <td>{ this.state.persons.datetime}</td>
    <td>{ this.state.persons.name}</td>
    <td>{ this.state.persons.summary}</td>
    <td>{ this.state.persons.url}</td>
    <td>{ this.state.persons.type}</td>
    <td>{ this.state.persons.location}</td>
  </tr>
  </tbody>
</table>
</Container>
    )
  }
}
